import React from 'react'
import Titre from '../../ComponentsReutilisables/GlobalComponent/Titre'
import ParaProject from '../../ComponentsReutilisables/ProjectComponent/ParaProject'
import company from "../../Asset/Img/company.jpg"
import collection  from"../../Asset/Img/collection.jpg"
import forum  from"../../Asset/Img/forum.jpg" ;
import github from '../../Asset/Img/github.png';
import react from '../../Asset/Img/react.png';
import node from '../../Asset/Img/node.png';
import tailwind from '../../Asset/Img/tailwind.png';
import mongodb from '../../Asset/Img/mongodb.png';
import fm from '../../Asset/Img/fm.png';
import { useContext } from 'react'
import langueContext from '../../context/LangueContext'
import tabTexteProjet from '../../tools/tab/tabProjet/TabTexteProjet'

export default function Project() {
  const {langue} = useContext(langueContext);
  return (
    <div   className='projet bg-belge  '>
        <Titre  color="text-noir" contenu={langue==="anglais"? "Project": "Projet"}></Titre>
        <div className='sup480:pt-[100px] sup480:pb-[20px] sup768:pt-[110px]  sup1024:pt-[120px] sup1024:gap-10 sup1024:grid-cols-[repeat(3,1fr)] sup1600:pt-[130px]  w-[80%] grid grid-rows-[repeat(3,1fr)] grid-cols-[repeat(1,1fr)] my-0 mx-auto max-w-[1400px] pt-[80px] pb-[10px] '>
          <ParaProject 
            source={company} 
            srcImg={[github,react,tailwind]} 
            titre={langue==="anglais"? tabTexteProjet.titre.ang[0] : tabTexteProjet.titre.fr[0]} 
            contenu={langue==="anglais"? tabTexteProjet.texte.ang[0] : tabTexteProjet.texte.fr[0]} 
            number="un">
          </ParaProject>
          <ParaProject 
            source={collection} 
            srcImg={[github,react,tailwind,fm]} 
            titre={langue==="anglais"? tabTexteProjet.titre.ang[1] : tabTexteProjet.titre.fr[1]} 
            contenu={langue==="anglais"? tabTexteProjet.texte.ang[1] : tabTexteProjet.texte.fr[1]} 
            number="deux">
          </ParaProject>
          <ParaProject 
            source={forum} 
            srcImg={[github,react,tailwind,node,mongodb]} 
            titre={langue==="anglais"? tabTexteProjet.titre.ang[2] : tabTexteProjet.titre.fr[2]} 
            contenu={langue==="anglais"? tabTexteProjet.texte.ang[2] : tabTexteProjet.texte.fr[2]} 
            number="trois">
          </ParaProject>
        </div>
    </div>
  )
}
